/// id : "1"
/// name : "United Pharmacies"
/// stores : [{"id":"1","code":"en","name":"English"},{"id":"2","code":"ar","name":"العربية"}]

class StoreData {
  StoreData({
      String? id, 
      String? name, 
      List<Stores>? stores,}){
    _id = id;
    _name = name;
    _stores = stores;
}

  StoreData.fromJson(dynamic json) {
    _id = json['id'];
    _name = json['name'];
    if (json['stores'] != null) {
      _stores = [];
      json['stores'].forEach((v) {
        _stores?.add(Stores.fromJson(v));
      });
    }
  }
  String? _id;
  String? _name;
  List<Stores>? _stores;
StoreData copyWith({  String? id,
  String? name,
  List<Stores>? stores,
}) => StoreData(  id: id ?? _id,
  name: name ?? _name,
  stores: stores ?? _stores,
);
  String? get id => _id;
  String? get name => _name;
  List<Stores>? get stores => _stores;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['id'] = _id;
    map['name'] = _name;
    if (_stores != null) {
      map['stores'] = _stores?.map((v) => v.toJson()).toList();
    }
    return map;
  }

}

